import React, {useState} from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import Context from './Context';

const [pizzasCart, setPizzasCart] = useState(function() {
  let bin = JSON.parse(localStorage.getItem("pizzas")) || [];
  return bin;
});

ReactDOM.render(
  <Context.Provider>
    <React.StrictMode>
      <App />
    </React.StrictMode>
  </Context.Provider>,
  document.getElementById('root')
);
